import Axios from 'axios';
import React, { Component } from 'react'

export class ListEmploi extends Component {
    state={
        annonces: []
    }

    componentDidMount = () => {
        this.getAnnonces();
    }

    getAnnonces = () => {
        Axios.get('annonce').then(resp => {
            this.setState({
                annonces: resp.data
            })
        })
    }
    render() {
        console.log(this.state.annonces)
        return (
            <>
                <div className="col-md-4 d-flex  ">
